window.bookSummaryJSON = "<p><b>They have returned. Now the galaxy will burn.</b></p> <p>An ancient foe lurks in the shadows...licking its wounds and assembling its forces.</p> <p>Risen from the ashes and shrouded in darkness, these ancient beings are waiting for the perfect opportunity to strike back and set the universe on fire.</p> <p>After their world is ambushed in a devastating onslaught, the Star Alliance is nearly wiped out in one fell swoop. Hotheaded pilot Chase Athanatos leads the barely surviving fleet to the far edge of space and a small backwater planet.</p> <p>A little-known world called Earth.</p> <p>In doing so, the Alliance unwittingly puts Earth in the crosshairs of an intergalactic, eons-old conflict between ancient foes and god-like creatures known as the Olympians.</p> <p>Chase’s people must join forces with the citizens of modern-day Earth if they hope to survive the resurgence of an enemy once thought extinct.</p> <p>When it becomes clear that his Fury powers are awakening, Chase must face his inner demons and learn to control them, or he could very well destroy the universe he has sworn to protect.</p> <p>If he doesn’t succeed, then the galaxy will fall into darkness.</p> <p>Forever.</p> <p>Box set includes the following titles, in chronological order:</p> <p>1. <i>Wings of Destiny</i></p> <p>2. <i>Earth Last Sanctuary</i></p> <p>3. <i>Damocles' Fall</i></p> <p>4. <i>Way of the Warrior</i></p> <p>5. <i>Fury to the Stars</i></p> <p>6. <i>Into the Abyss</i></p> <p>7. <i>Course Correction</i></p> <p>8. <i>Destination Oblivion</i></p> <p><b>Immerse yourself in the best-selling space opera series - download this epic box set today.</b></p>"; 
